import style from "styled-components";
import perfil from "../../images/perfil.svg";
import sacola  from "../../images/sacola.svg";

const iconOption = [perfil, sacola];

const IconList = style.li`
    margin-right: 2.5rem;
    width: 1.563rem;
`;
const Icons = style.ul`
    align-items: center;
    display: flex;
`;

function OptionsIconHeader() {
    return (
        <Icons>
            {iconOption.map(icon => 
            <IconList>
                <img src={icon} alt=''></img>
            </IconList>)}
        </Icons>
    )
};

export default OptionsIconHeader;
